class CUTEARRAY {
    static void assertFalse(boolean v, String errmsg) {assert (v == false): errmsg;}
    static void assertTrue(boolean v, String errmsg) {assert (v == true): errmsg;}
    public static int cutearray(int[] a){
    int sum_1 = 0;
    int i_1 = 0;
    assertTrue(0 < a.length - 2, "Path condition is violated: assertTrue(0 < a.length - 2) //[1]");
    assertFalse((a[0] + a[1] + a[2]) % 7 == 0, "Path condition is violated: assertFalse((a[0] + a[1] + a[2]) % 7 == 0) //[2]");
    i_1++;
    assertTrue(1 < a.length - 2, "Path condition is violated: assertTrue(1 < a.length - 2) //[3]");
    assertTrue((a[1] + a[2] + a[3]) % 7 == 0, "Path condition is violated: assertTrue((a[1] + a[2] + a[3]) % 7 == 0) //[4]");
    sum_1 += 1;
    a[i_1 + 1] += 1;
    i_1++;
    assertFalse(2 < a.length - 2, "Path condition is violated: assertFalse(2 < a.length - 2) //[5]");
    return 1;
}


public static void main(String args[]) { ; }
}
